import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import ItemDetails from './Component/Common/ItemDetail';
import AddItemForm from './Component/Seller/AddItemForm';
import ItemList from './Component/Common/ItemList';

const App = () => {
    return (
        <Router>
            <Routes>
                <Route path="/" exact component={ItemList} />
                <Route path="/item-details/:itemId" component={ItemDetails} />
            </Routes>
        </Router>
    );
};

export default App;
